import React from 'react'
import { Text, View } from 'react-native';
import LottieView from 'lottie-react-native';

function Settings() {
    return (
        <View  style={{ flex: 0.2, marginLeft:'56%'}}>

            <LottieView
                source={require('../assets/request-lottie.json')}
                autoPlay
            />
        </View>
    )
}
export default Settings
